import React, { Component } from "react";

class NotesContainer extends Component {
  constructor() {
    super();
    this.state = {
      name: "Profile"
    };
  }

  render() {
    return (
        <div className="noteSection">
            NOTES
        </div>
    )
  }
}

export default NotesContainer;
